insert into proxybuyboard values( pr_num.nextval, 'pie1143', '김파이1143', 'life', '공무원인 근로자는 법률이 정하는 자에 한하여 단결권·단체교섭...', '대통령은 제3항과 제4항의 사유를 지체없이 공포하여야 한다. 대통령의 국법상 행위는 문서로써 하며, 이 문서에는 국무총리와 관계 국무위원이 부서한다. 군사에 관한 것도 또한 같다.', 'default.png', 'img3.jpg/', '26', '#세제#샴푸#선물세트', 1, TO_DATE('20240304','YYYYMMDD'), TO_DATE('20240304','YYYYMMDD'), TO_DATE('20240313','YYYYMMDD'), 8, 1, 10000, 1250, '11:11:11:43',0,'test','testedProduct');
insert into proxybuyboard values( pr_num.nextval, 'pie1144', '김파이1144', 'beautyAndFashion', '대통령의 임기는 5년으로 하며, 중임할 수 없다. 제3항의 승인을...', '대통령은 취임에 즈음하여 다음의 선서를 한다. 국회는 국민의 보통·평등·직접·비밀선거에 의하여 선출된 국회의원으로 구성한다. 대통령은 제1항과 제2항의 처분 또는 명령을 한 때에는 지체없이 국회에 보고하여 그 승인을 얻어야 한다.', 'default.png', 'img4.jpg/', '41', '#게임팩#pc', 1, TO_DATE('20240305','YYYYMMDD'), TO_DATE('20240305','YYYYMMDD'), TO_DATE('20240314','YYYYMMDD'), 4, 1, 90000, 22500, '11:11:11:44',0,'test','testedProduct');
insert into proxybuyboard values( pr_num.nextval, 'pie1145', '김파이1145', 'etc', '대법원은 법률에 저촉되지 아니하는 범위안에서 소송에 관한 절...', '대통령은 법률이 정하는 바에 의하여 사면·감형 또는 복권을 명할 수 있다. 형사피고인은 유죄의 판결이 확정될 때까지는 무죄로 추정된다. 법률안에 이의가 있을 때에는 대통령은 제1항의 기간내에 이의서를 붙여 국회로 환부하고, 그 재의를 요구할 수 있다. 국회의 폐회중에도 또한 같다.', 'default.png', 'img5.jpg/', '29', '#자켓#가을#체크', 1, TO_DATE('20240306','YYYYMMDD'), TO_DATE('20240306','YYYYMMDD'), TO_DATE('20240315','YYYYMMDD'), 5, 1, 10000, 2000, '11:11:11:45',0,'test','testedProduct');
insert into proxybuyboard values( pr_num.nextval, 'pie1146', '김파이1146', 'pet', '훈장등의 영전은 이를 받은 자에게만 효력이 있고, 어떠한 특권...', '탄핵결정은 공직으로부터 파면함에 그친다. 그러나, 이에 의하여 민사상이나 형사상의 책임이 면제되지는 아니한다. 헌법에 의하여 체결·공포된 조약과 일반적으로 승인된 국제법규는 국내법과 같은 효력을 가진다.', 'default.png', 'img6.jpg/', '12', '#강아지#원단#베레모', 1, TO_DATE('20240307','YYYYMMDD'), TO_DATE('20240307','YYYYMMDD'), TO_DATE('20240316','YYYYMMDD'), 7, 1, 40000, 5715, '11:11:11:46',0,'test','testedProduct');
