insert into proxybuyboard values( pr_num.nextval, 'pie1148', '김파이1148', 'food', '국회는 선전포고, 국군의 외국에의 파견 또는 외국군대의 대한민...', '모든 국민은 고문을 받지 아니하며, 형사상 자기에게 불리한 진술을 강요당하지 아니한다. 대통령이 임시회의 집회를 요구할 때에는 기간과 집회요구의 이유를 명시하여야 한다.', 'default.png', 'img2.jpg/', '23', '#게임팩#pc', 1, TO_DATE('20240309','YYYYMMDD'), TO_DATE('20240309','YYYYMMDD'), TO_DATE('20240318','YYYYMMDD'), 2, 1, 100000, 50000, '11:11:11:48',0,'test','testedProduct');
insert into proxybuyboard values( pr_num.nextval, 'pie1149', '김파이1149', 'life', '지방의회의 조직·권한·의원선거와 지방자치단체의 장의 선임방...', '공개하지 아니한 회의내용의 공표에 관하여는 법률이 정하는 바에 의한다. 제2항의 재판관중 3인은 국회에서 선출하는 자를, 3인은 대법원장이 지명하는 자를 임명한다.', 'default.png', 'img3.jpg/', '45', '#자켓#가을#체크', 0, TO_DATE('20240310','YYYYMMDD'), TO_DATE('20240310','YYYYMMDD'), TO_DATE('20240319','YYYYMMDD'), 1, 1, 70000, 70000, '11:11:11:49',0,'test','testedProduct');
